import React from "react";
import useBreadcrumbs from "use-react-router-breadcrumbs";

const Breadcrums = () => {
  const breadcrumbs = useBreadcrumbs();

  return (
    <React.Fragment>
      {breadcrumbs.map(({ breadcrumb }) => breadcrumb)}
    </React.Fragment>
  );
};

export default Breadcrums;
